import React, {useEffect, useState} from 'react';
import "./calendar.scss"
import Prim from "./prim";
import InfoCal from "./info_cal";
import Partner from "./partner";
import logo from "../../img/logoDB.png"
import afisha from "../../img/календарь.jpg"
import classNames from "classnames";
const Calendar = () => {
    const [hidden, SetState] = useState(false)
    const [buttonText, SetText] = useState("Показать больше")
    const classes = classNames({
        hidden:hidden,
        "cont_desc_hide":hidden,
        "cont_desc":!hidden,
    })
    useEffect(() => {
        // if (hidden === false) {
        //     SetText("Показать больше");
        //     document.getElementById('cont_desc').className = "cont_desc_hide";
        // } else {
        //     SetText("Скрыть")
        //     document.getElementById('cont_desc').className = "cont_desc";
        // }
    });
    // useEffect(() => {
    //     document.getElementById('cont_desc').className = "hidden";
    // }, []);
    return (
        <div className="main_shadow">
            <img className="afisha_img" src={afisha}/>
            <div className="cal_cont">
                <div className="cal_cont1">
                    <div className="prim_cont">
                        <Prim text={"ОГРОММНЫЙ ПРИЗОВОЙ ФОНД"}/>
                        <Prim text={"ОГРОММНЫЙ ПРИЗОВОЙ ФОНД"}/>
                        <Prim text={"Большой розыгрыз призов от спонсоров"}/>
                    </div>
                    <div className="cont_info">
                        <div className="cont_info1">
                            <div className="cont_info_name">Открытие г. Волгоград
                            </div>
                            <div className="cont_info_reg">
                                <div className="cont_info_reg_btn">Зарегистрироваться
                                </div>
                            </div>
                            <div className="cont_info_list">Список участников
                            </div>
                        </div>
                        <div className="cont_info_btn_close">
                            <button className="cont_info_btn_close_text">{hidden ? "Скрыть" : "Показать больше"}
                            </button>
                            {/*<div className="p-5 bg-gradient-to-b from-zinc-900 to-zinc-900 rounded-[66px] border border-neutral-800 justify-start items-start gap-2.5 flex">*/}
                            {/*    <div className="w-[34px] h-[34px] relative"/>*/}
                            {/*</div>*/}
                        </div>
                    </div>
                </div>
                <div className={classes} >
                    <div className="cont_desc1">
                        <div className="cont_desc_name">Описание этапа
                        </div>
                        <div className="cont_desc_desc">СОБЫТИЕ,
                            КОТОРОЕ НЕВОЗМОЖНО ПРОПУСТИТЬ Мы ждём множество гостей и спортсменов из разных
                            уголков страны Заезд с 8:00 Регистрация и судейство до 10:00 Начало замеров 10:30
                            Награждение 20:00 Фаер Шоу 21:00 Большой розыгрыш призов 21:30
                        </div>
                    </div>
                    <div className="full_desc">
                        <InfoCal data={["Волгоград", "ТРЦ Акварель", "6 Мая 2023", "Открытие"]}/>
                        <div className="info_part">
                            <div className="info_part_text">Партнеры</div>
                            <div className="info_part_cont">
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                                <Partner data={["Alphard Group", logo]}/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>

    );
};

export default Calendar;
